import React from "react";
import "../../Styling/account.css";
import { Link } from "react-router-dom";
import { useForm } from "react-hook-form";

interface FormData {
  firstname: string;
  lastname: string;
  date: Date;
  email: string;
  password: string;
}

function SignUp() {
  const {
    register,
    handleSubmit,
    formState: { errors },
  } = useForm<FormData>();
  console.log(register);

  return (
    <>
      <div className="backDesign">
        <div className="d-flex align-items-center justify-content-center h-100">
          <div className="box">
            <h2 className="signHead">SignUp</h2>
            <form className="d-flex flex-column">
              <input
                {...register("firstname", {
                  required: "enter firstname",
                  minLength: {
                    value: 3,
                    message: "please enter more than 3 words",
                  },
                })}
                type="text"
                placeholder="Firstname"
                className="my-2"
              />
              <p className="text-danger">{errors.firstname?.message}</p>
              <input
                {...register("lastname", {
                  required: "enter Lastname",
                  minLength: {
                    value: 3,
                    message: "please enter more than 3 words",
                  },
                })}
                type="text"
                placeholder="Lastname"
                className="my-2"
              />

              <p className="text-danger">{errors.lastname?.message}</p>

              <input type="date" placeholder="Date of Birth" className="my-2" />
              <input type="email" placeholder="Email" className="my-2" />
              <input type="password" placeholder="Passowrd" className="my-2" />
              {/* <Link to="/account/login" className="w-100"> */}
              <button className="signBtn w-100" type="submit">
                Sign Up
              </button>
              {/* </Link> */}
            </form>
          </div>
        </div>
      </div>
    </>
  );
}

export default SignUp;
